description:
&quot;The unprofessional conduct continues when a suddenly unemployed Autum applies for a job at lesbian lover Jasmine's firm. But Autum soon learns that bitchy blonde boss Kate has a weakness for brunettes, and she'll stop at nothing to get doe-eyed Jasmine in her bed. Meanwhile, Kate's favorite &quot;girl-toy&quot; Taylor Vixen craves the touch of a girl her own age, and young, blonde coworker Lily is more than happy to oblige. Starring Autum Moon, Kate Kastle, Jasmine Jem, Taylor Vixen and Lily Labeau. Written and directed by Nica Noelle.&quot;

